template<class T> void 
TowTruckOpenGLModel<T>::OGL_Set_Current_Material_Parameters(float shininess, float r_diffuseColor, float g_diffuseColor, float b_diffuseColor, float r_specularColor, float g_specularColor, float b_specularColor)
{
	if( _bshadow ) 
	{
		return;
	}
	GLfloat glfModelSpecular[4];

	// This causes the polygon's ambient & diffuse colors to be derived from the glColor() value.
	glColorMaterial(GL_FRONT_AND_BACK, GL_AMBIENT_AND_DIFFUSE);
	glMaterialf(GL_FRONT_AND_BACK, GL_SHININESS, shininess*0.1f);
	/* Set the specular shading color. */
	r_specularColor *= 0.1f;
	g_specularColor *= 0.1f;
	b_specularColor *= 0.1f;

	glfModelSpecular[0] = r_specularColor;
	glfModelSpecular[1] = g_specularColor;
	glfModelSpecular[2] = b_specularColor;
	glMaterialfv(GL_FRONT_AND_BACK, GL_SPECULAR, glfModelSpecular);

	r_diffuseColor *= 0.8f;
	g_diffuseColor *= 0.8f;
	b_diffuseColor *= 0.8f;

	r_diffuseColor *= _fLightingFraction;
	g_diffuseColor *= _fLightingFraction;
	b_diffuseColor *= _fLightingFraction;

	glColor3f(r_diffuseColor, g_diffuseColor, b_diffuseColor);
}

// Please replace this routine with one of your own which will load in the
// requested texture map and make it current within the OpenGL context.
// If the texture map name is NULL then disable texture mapping.
template<class T> void 
TowTruckOpenGLModel<T>::OGL_Set_Current_Texture_Map(char *texture_map_name, float u_scale, float v_scale, float u_offset, float v_offset)
{
	if( texture_map_name == NULL || strlen(texture_map_name) == 0 || _bshadow)
	{
		glDisable( GL_TEXTURE_2D );
		return;
	}
}

